INSERT INTO `posts` (`id`, `title`, `text`, `full_text`, `img`, `created_at`, `updated_at`) VALUES
(1, 'Летать - легко!', 'Мы упрощаем путешествие от бронирования до полета и даем вам больше контроля. Узнайте,\r\n                как мы отменяем сборы за внесение изменений и упрощаем корректировку ваших планов\r\n                поездок.', 'Мы готовы открыть перед вами весь мир. Никогда еще планировать путешествия не было так просто! Стоит лишь коснуться экрана, и перед вами самые популярные направления и лучшие цены. Мы стремимся сделать путешествия легкими и комфортными для всех. Мы хотим, чтобы весь путь планирования поездки, бронирования билетов был простым и понятным, от начала и до конца. Чтобы потраченные деньги окупались незабываемыми впечатлениями. Чтобы индустрия туризма стала более открытой, и мы всегда оправдывали ваше доверие.\n\nИменно эти идеи мы вкладываем во всё, что делаем. Мы всегда на вашей стороне и гордимся тем, что вы платите нам своим доверием (согласно отзывам путешественников рейтинг нашего сайта выше, чем у наших конкурентов).\n\nМы всегда ставим ваши интересы во главу угла. Убедитесь сами! Вот что мы вам предлагаем.', '1', NULL, NULL),
(2, 'Почувствуй чистоту!', 'Мы делаем все возможное, чтобы обеспечить безопасное, здоровое и чистое путешествие. Забота о наших клиентах и сотрудниках является нашим главным приоритетом.', 'Ради безопасности наших клиентов. После каждого полета, наши сотрудники полностью убирают весь мусор и грязь из самолета. Обеззараживают отдельно, каждое пассажирское место. ', '3', NULL, NULL),
(5, 'В аэропортах Лондона отменены десятки рейсов', 'Десятки рейсов отменены в аэропортах Лондона из-за нехватки персонала на фоне наплыва пассажиров перед пасхальными праздничными выходными, пишет газета Guardian.', 'По данным издания, British Airways отменила по меньшей мере 64 внутренних рейса и полетов в европейские страны из аэропорта Хитроy, а авиакомпания EasyJet – 25 рейсов в аэропорт Гатвик.\nЗа последнюю неделю в аэровокзалах по всей Британии выстраиваются большие очереди из-за того, что родители с детьми отправляются на каникулы.', '2', NULL, NULL);
